import React from "react";
import { Outlet } from "react-router-dom";

import "./stiliai.css";

import Headeris from "../komponentu_biblioteka/headeris";
import Meniu from "../komponentu_biblioteka/meniu";
import Footeris from "../komponentu_biblioteka/footeris";

//Pagrindinis viso puslapio dizainas
function Layoutas() {
  let kontaktu_masyvas = ["Adresas: Mano 10", "Telefonas:112", "email:aaa@bbb"];

  let meniu_komandos = [
    { adresas: "/", pavadinimas: "Pagrindinis" },
    { adresas: "/skaiciavimai", pavadinimas: "Skaiciuoti" },
    { adresas: "/apie", pavadinimas: "Apie" },
  ];

  return (
    <>
      <Headeris
        stilius={{ backgroundColor: "navy", padding: "20px" }}
        logo="smile.jpg"
        logo_plotis="70px"
      />

      <Meniu
        komandos={meniu_komandos}
        klase="meniu"
        stilius={{ backgroundColor: "navy", color: "white" }}
      />
      <div className="turinys">
        <Outlet />
      </div>

      <Footeris
        pavadinimas="Kontaktai"
        elementai={kontaktu_masyvas}
        stilius={{ backgroundColor: "black", color: "white", padding: "20px" }}
      />
    </>
  );
}

export default Layoutas;
